export default {
  name: 'contactPage',
  data: function () {
    return {
      showResMessage: false,
      isResSuccess: false,
      env: process.env.NODE_ENV,
      resMessage: '',
      form: {
        emailTo: '',
        messageBody: ''
      }
    }
  },

  methods: {
    submit () {
      this.$store.dispatch('contacUsEmail', this.form).then(res => {
        this.showResMessage = true
        this.isResSuccess = res.isSuccess
        this.resMessage = res.message
      }).catch((err) => {
        console.log(err)
        this.showResMessage = true
        this.isResSuccess = res.isSuccess
        this.resMessage = res.message
      })
    }
  }
}
